import React , { useState } from 'react';

function App(){

  const [ctime , stime] = useState(newTime);

  function GetTime(){
    let newTime = new Date().toLocaleTimeString();
    stime(newTime);
  }
  return(
    <>
      <h1>This is {ctime}</h1>
      <button onClick={GetTime}>Get Time</button>
    </>
  )
}

export default App;
